**Playwright MCP→Codex CLI 流程**

- 准备环境：确保已安装 Node.js ≥ 18（`node -v` 验证），并在项目或全局有 npm。官方 MCP Server 依赖 Playwright 浏览器二进制，首次使用前执行 `npx playwright install` 下载 Chromium 等引擎。citeturn0playwright1
- 获取官方服务器：  
  - 临时调用：`npx @playwright/mcp@latest`（每次拉取最新版本）。  
  - 或全局安装：`npm install -g @playwright/mcp`，随后可直接运行 `playwright-mcp`.citeturn0playwright1
- 首次自测（可选）：在终端运行 `playwright-mcp --port 8080`；浏览器自动拉起前会检查依赖，若缺失会提示执行 `python -m playwright install chromium` 等命令。citeturn0playwright1turn0playwright2
- 接入 Codex CLI：  
  - 找到 Codex CLI 使用的 MCP 配置（与现有工具相同的 JSON/YAML）。  
  - 新增条目，例如：  
    ```jsonc
    {
      "mcpServers": {
        "playwright": {
          "command": "npx",
          "args": ["@playwright/mcp@latest"],
          "env": {
            "PLAYWRIGHT_BROWSERS_PATH": "<可选：自定义浏览器缓存目录>"
          }
        }
      }
    }
    ```  
  - 若采用全局安装，则把 `command` 改成 `playwright-mcp` 或写入绝对路径。Codex CLI 下次启动或 reload 配置后，就会自动注册该 MCP Server 及其工具列表。citeturn0playwright1turn0playwright3
- （可选）固定监听或鉴权：需要网络复用时可在 `args` 里追加 `--host`, `--port`, `--allowed-hosts`, `--auth-token` 等参数，Codex CLI 端配置对应的 `ws://` 或 `http(s)` 地址即可远程复用同一 Playwright MCP 服务。citeturn0playwright1turn0playwright2

下一步可在 Codex CLI 中调出可用工具列表，确认出现 `browser_navigate`、`browser_click` 等官方 Playwright 方法；若需持久上下文或截图目录，可继续在 CLI 配置里通过环境变量自定义。

